import React, { useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [selectedImage, setSelectedImage] = useState(null);
  const [description, setDescription] = useState('');
  const [visualStory, setVisualStory] = useState(null);
  const [loading, setLoading] = useState(false);
  const [previewImage, setPreviewImage] = useState(null);

  const handleImageUpload = (event) => {
    const file = event.target.files[0];
    setSelectedImage(file);

    // Create preview URL for the selected image
    if (file) {
      const reader = new FileReader();
      reader.onloadend = () => {
        setPreviewImage(reader.result);
      };
      reader.readAsDataURL(file);
    }
  };

  const generateDescription = async () => {
    if (!selectedImage) {
      alert('Please select an image first');
      return;
    }

    setLoading(true);
    const formData = new FormData();
    formData.append('image', selectedImage);

    try {
      const response = await axios.post('http://localhost:8080/generate_description', formData, {
        headers: {
          'Content-Type': 'multipart/form-data'
        }
      });
      setDescription(response.data.description);
    } catch (error) {
      console.error('Error generating description:', error);
      alert('Error generating description');
    } finally {
      setLoading(false);
    }
  };

  const generateVisualStory = async () => {
    if (!description) {
      alert('Please generate a description first');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.post('http://localhost:8080/generate_visual_story');
      setVisualStory(response.data);
    } catch (error) {
      console.error('Error generating visual story:', error);
      alert(error.response?.data?.error || 'Error generating visual story');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Visual Story Generator</h1>
      </header>

      <main className="App-main">
        <div className="upload-section">
          <input
            type="file"
            accept="image/*"
            onChange={handleImageUpload}
            className="file-input"
          />
          {previewImage && (
            <div className="preview-container">
              <img src={previewImage} alt="Preview" className="preview-image" />
            </div>
          )}
          <div className="button-group">
            <button 
              onClick={generateDescription}
              disabled={!selectedImage || loading}
              className="action-button"
            >
              Generate Description
            </button>
            <button 
              onClick={generateVisualStory}
              disabled={!description || loading}
              className="action-button"
            >
              Generate Visual Story
            </button>
          </div>
        </div>

        {loading && (
          <div className="loading">
            <div className="loading-spinner"></div>
            <p>Processing your request...</p>
          </div>
        )}

        {description && (
          <div className="description-section">
            <h2>Image Description</h2>
            <div className="content-box">
              {description}
            </div>
          </div>
        )}

        {visualStory && (
          <div className="story-container">
            {visualStory.map((item, index) => (
              <div key={index} className="story-segment">
                <img 
                  src={`data:image/jpeg;base64,${item.data}`} 
                  alt={`Generated ${index + 1}`}
                  className="generated-image"
                />
                <div className="text-content">
                  <p className="description"><strong>Description:</strong> {item.description}</p>
                  <p className="paragraph">{item.paragraph}</p>
                </div>
              </div>
            ))}
          </div>
        )}
      </main>
    </div>
  );
}

export default App;
